            <MenuIcon />
            <img src="https://www.google.com/imgres?imgurl=https%3A%2F%2Fwww.youtube.com%2Fabout%2Fstatic%2Fsvgs%2Ficons%2Fbrand-resources%2FYouTube-logo-full_color_light.svg%3Fcache%3D72a5d9c&imgrefurl=https%3A%2F%2Fwww.youtube.com%2Fabout%2Fbrand-resources%2F&tbnid=mJe9Z8aqJSzHdM&vet=12ahUKEwjrlKL-xMXtAhXNDN4KHXGKArcQMygAegUIARDRAQ..i&docid=jLf4Mwq9IGBfWM&w=800&h=179&q=youtube%20logo&ved=2ahUKEwjrlKL-xMXtAhXNDN4KHXGKArcQMygAegUIARDRAQ" alt="" />
        </div>
    );
}

export default Header
